// ValidateInviteMemberRequestBody runs the validations defined on
// InviteMemberRequestBody
func ValidateInviteMemberRequestBody(body *InviteMemberRequestBody) (err error) {
	if body.OrganizationID == nil {
		err = goa.MergeErrors(err, goa.MissingFieldError("organization_id", "body"))
	}
	if body.Email == nil {
		err = goa.MergeErrors(err, goa.MissingFieldError("email", "body"))
	}
	if body.Email != nil {
		err = goa.MergeErrors(err, goa.ValidateFormat("body.email", *body.Email, goa.FormatEmail))
	}
	if body.Email != nil {
		if utf8.RuneCountInString(*body.Email) > 255 {
			err = goa.MergeErrors(err, goa.InvalidLengthError("body.email", *body.Email, utf8.RuneCountInString(*body.Email), 255, false))
		}
	}
	return
}

// ValidateResendInviteRequestBody runs the validations defined on
// ResendInviteRequestBody
func ValidateResendInviteRequestBody(body *ResendInviteRequestBody) (err error) {
	if body.InviteID == nil {
		err = goa.MergeErrors(err, goa.MissingFieldError("invite_id", "body"))
	}
	if body.InviteID != nil {
		err = goa.MergeErrors(err, goa.ValidateFormat("body.invite_id", *body.InviteID, goa.FormatUUID))
	}
	return
}

